<!DOCTYPE html>
<html lang="ko">
<head>
    <meta charset="UTF-8">
    <meta http-equiv="X-UA-Compatible" content="IE=edge">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Error Trace</title>

    <link rel="stylesheet" href="css/jquery-ui.css">
    <link rel="stylesheet" href="css/jquery-ui.min.css">
    <link rel="stylesheet" href="css/common.css">
    <link rel="stylesheet" href="css/index.css">
    <link rel="stylesheet" href="css/custom_chart.css">
    <link rel="stylesheet" href="css/popup.css">
    <link rel="stylesheet" href="css/font-awesome.min.css">
    <!-- <link rel="stylesheet" href="css/jui-ui.classic.css"> -->

    <script src="js/jquery-2.2.4.min.js"></script>
    <script src="js/jui-core.js"></script>
    <script src="js/jui-chart.js"></script>
    <script src="js/jquery.js"></script>
    <script src="js/jquery-ui.js"></script>
    <script src="js/jquery-ui.min.js"></script>
    <script src="js/jui-ui.js"></script>
</head>
<body> 
      

    <div id="viewErrorTrace" class="popup">
        <article class="content-inner">
            <div class="index-table-flex">
                <div class="index-table">
                    <div class="content-title">Call Stack
                        <!-- <div id="closePopup" class="close"></div> -->
                    </div>
                    <div class="popup-inner scroll">
                        <ul class="tree arrow"></ul>
                        <script id="tpl_tree" type="text/template">
                            <li>
                                <div><i class="symbol <!= symbol !>"></i> <!= title !></div>
                                <ul></ul>
                            </li>
                        </script>

                    </div>
                    <div class="cover-bar"></div>
                </div>
            </div>
        </article>
    </div>

    <script src="js/custom_chart.js"></script>
    <script src="js/popup.js"></script>
  
</body>
</html>
